--  DDL for Trigger USER_GRADE_UPDATE_TRIGGER
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE TRIGGER "TEAM04"."USER_GRADE_UPDATE_TRIGGER" 
after update of grade on user_grade_t
FOR EACH ROW
BEGIN
    if :new.grade = 2 then -- 골드
        for i in 1..2
        loop
            values (3, :old.user_id);
        end loop;
    elsif :new.grade = 3 then -- 플레티넘
        for i in 1..2
        loop
            values (4, :old.user_id);
        end loop;
        values (7, :old.user_id);
    elsif :new.grade = 4 then -- 다이아
        for i in 1..2
        loop
            values (5, :old.user_id);
        end loop;
        values (8, :old.user_id);
    elsif :new.grade = 5 then -- 탑클래스
        for i in 1..2
        loop
            values (6, :old.user_id);
        end loop;
        values (9, :old.user_id);
    end if;

END;
/
ALTER TRIGGER "TEAM04"."USER_GRADE_UPDATE_TRIGGER" ENABLE;
