--------------------------------------------------------
--  DDL for Procedure ORDER_PAYMENT_INSERT
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "TEAM04"."ORDER_PAYMENT_INSERT" 
(
 -- prd_order_t
 p_prd_order_id IN prd_order_t.prd_order_id%TYPE,
 p_user_id IN prd_order_t.user_id%TYPE,
 p_recipient IN prd_order_t.recipient%TYPE,
 p_total_amount IN prd_order_t.total_amount%TYPE,
 p_discount_amount IN prd_order_t.discount_amount%TYPE,
 p_pmt_amount IN prd_order_t.pmt_amount%TYPE,
 p_address_dest IN prd_order_t.address_dest%TYPE,
 p_tel_no IN prd_order_t.tel_no%TYPE,
 p_hp_no IN prd_order_t.hp_no%TYPE,
 p_order_comment IN prd_order_t.order_comment%TYPE,
 p_order_date IN prd_order_t.order_date%TYPE,
 p_coupon_discount_amount IN prd_order_t.coupon_discount_amount%TYPE,
 p_reserve_discount_amount IN prd_order_t.reserve_discount_amount%TYPE,
 p_balance_discount_amount IN prd_order_t.balance_discount_amount%TYPE,
 
--prd_payment_t
  p_pmt_time IN prd_payment_t.pmt_time%TYPE,
  p_pmt_id IN prd_payment_t.pmt_id%TYPE,
  p_user_nm IN prd_payment_t.user_nm%TYPE,
  p_vbank_holder IN prd_payment_t.vbank_holder%TYPE,
  p_vbank_name IN prd_payment_t.vbank_name%TYPE,
  p_vbank_num IN prd_payment_t.vbank_num%TYPE,
  p_vbank_date IN prd_payment_t.vbank_date%TYPE,
  p_pay_status IN prd_payment_t.pay_status%TYPE,
  p_pay_method IN prd_payment_t.pay_method%TYPE,
  
  -- 적립예정 적립금
  p_expectPoint IN user_reserve_t.reserve%TYPE
 )
is
    v_currseq     prd_payment_t.prd_pmt_id%TYPE;
    v_pay_amount  prd_order_t.pmt_amount%TYPE;
begin
    --시퀀스
    select prd_payment_t_prd_pmt_id_seq.nextval into v_currseq
    FROM DUAL;

    -- 주문정보 insert
    values (p_prd_order_id, p_user_id, p_recipient, p_total_amount, p_discount_amount, p_pmt_amount, p_address_dest, p_tel_no, p_hp_no, p_order_comment, p_order_date, v_currseq, p_coupon_discount_amount, p_reserve_discount_amount, p_balance_discount_amount);

    -- 결제정보 insert
    values(v_currseq, p_prd_order_id, p_pmt_time, p_pmt_amount, p_pmt_id, p_user_nm, p_vbank_holder, p_vbank_name, p_vbank_num, p_vbank_date, p_pay_status, p_pay_method);

    -- 적립금 정보 update
    update user_reserve_t set
        reserve = reserve + (p_expectPoint - p_reserve_discount_amount)
    where user_id = p_user_id;

    -- 예치금 정보 update
    update user_balance_t set
        balance = balance - p_balance_discount_amount
    where user_id = p_user_id;

    -- 회원의 총 구매금액 update
    update user_grade_t set
        purchase_amount = purchase_amount + p_pmt_amount
    where user_id = p_user_id;

    -- 회원등급 update용
    select purchase_amount into v_pay_amount
    from  user_grade_t
    where user_id = p_user_id;

    -- 회원 등급 update
    if v_pay_amount >= 1000000 then
        update user_grade_t set
            grade = 5
        where user_id = p_user_id and grade <= 4;
    elsif v_pay_amount >= 500000 then
        update user_grade_t set
            grade = 4
        where user_id = p_user_id and grade <= 3;
    elsif v_pay_amount >= 100000 then
        update user_grade_t set
            grade = 3
        where user_id = p_user_id and grade <= 2;
    elsif v_pay_amount >= 10000 then
        update user_grade_t set
            grade = 2
        where user_id = p_user_id and grade <= 1;
    end if;

end;

