 p_prd_id IN rental_prd_order_t.prd_id%TYPE,
 p_order_flag IN rental_prd_order_t.order_flag%TYPE,
 
 -- rental_user_dt_t
 p_sdate IN rental_user_dt_t.sdate%TYPE,
 p_edate IN rental_user_dt_t.edate%TYPE,
 p_rental_flag IN rental_user_dt_t.rental_flag%TYPE,
 
-- prd_payment_t
  p_pmt_time IN prd_payment_t.pmt_time%TYPE,
