--  DDL for Procedure USER_T_UPDATE_USER_PROC
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "TEAM04"."USER_T_UPDATE_USER_PROC" (
	p_user_id IN user_t.USER_ID%TYPE,
	p_user_nm IN user_t.USER_NM%TYPE,
	p_email IN user_t.EMAIL%TYPE,
	p_birth IN user_t.BIRTH%TYPE,
	p_address_f IN user_t.ADDRESS_F%TYPE,
	p_address_l IN user_t.ADDRESS_L%TYPE,
	p_hp_no IN user_t.HP_NO%TYPE,
	p_gender IN user_t.GENDER%TYPE,
	o_ret_cnt OUT INTEGER )
IS 
	v_updtcnt INTEGER := 0;
BEGIN 
	UPDATE USER_T 
	SET USER_NM = p_user_nm,
		EMAIL = p_email,
		BIRTH = p_birth,
		ADDRESS_F = p_address_f,
		ADDRESS_L = p_address_l,
		HP_NO = p_hp_no,
		GENDER = p_gender,
		UPD_DT = systimestamp
	WHERE USER_ID = p_user_id;
	v_updtcnt := SQL%rowcount; -- affected row count
	-- 반드시 commit 전에 있어야함.
	COMMIT;
	DBMS_OUTPUT.PUT_LINE(v_updtcnt||' rows updated.');
	o_ret_cnt := v_updtcnt;
	EXCEPTION WHEN OTHERS THEN
		DBMS_OUTPUT.PUT_LINE('User Info Update Error!');
END;

