  CREATE OR REPLACE EDITIONABLE FUNCTION "TEAM04"."FN_CHECK_USER_EMAIL_NOT_ME_YN" (p_email varchar2, p_userid varchar2) RETURN varchar2
IS
	v_email user_t.email%type; 
BEGIN
	select NVL2(max(email), 'Y', 'N') into v_email
    from user_t
    where email = p_email
    AND user_id <> p_userid;

    return v_email;
END FN_CHECK_USER_EMAIL_NOT_ME_YN;

